import React, { useEffect, useState } from "react";

export default function TitleField({ text, tag }) {
  const [componentType, setComponentType] = useState();

  useEffect(() => {}, [tag]);

  return (
    <div className="title">
      <h1>{text}</h1>
    </div>
  );
}
